import React from "react";

class AddFishForm extends React.Component
{ 
    createfish=(e)=>{
      e.preventDefault();
      
        
    }

    
    render()
    {
        return(
            <form className="fish-edit" onSubmit={this.createfish}>
                {/* <p>Hi</p>
                 */}
                 <input name="name" type="text" placeholder="Name"></input>
                 <input name="price" type="text" placeholder="Price"></input>
                 <select name="status">
                 
                    <option value={"available"}>Fresh</option>
                    <option value={"unavailable"}>Soldout</option>

                 </select>
                 <textarea name="desc" type="text" placeholder="Provide description"></textarea>
                 <input name="image" type="text" placeholder="Image"></input>
                 <button type="submit">+Add Fish</button>

            </form>
     
        );
    }
}

export default AddFishForm;
